 p_id=>wwv_flow_api.id(7548905281116969667)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'COM.FARZAD.APEX.FLIP.COUNT'
,p_display_name=>'APEX Flip CountDown'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION render_item(p_item                IN apex_plugin.t_page_item,',
'                     p_plugin              IN apex_plugin.t_plugin,',
'                     p_value               IN VARCHAR2,',
'                     p_is_readonly         IN BOOLEAN,',
'                     p_is_printer_friendly IN BOOLEAN)',
'RETURN apex_plugin.t_page_item_render_result IS',
'  -- Custom Plugin Attributes',
'  l_result           apex_plugin.t_page_item_render_result;',
'  l_counter_mode     p_item.attribute_01%TYPE := apex_escape.html(p_item.attribute_01); -- Counter Mode',
'  l_size             p_item.attribute_02%TYPE := apex_escape.html(p_item.attribute_02); -- Size',
'  l_start_from       p_item.attribute_03%TYPE := apex_escape.html(p_item.attribute_03); -- Start From',
'  l_showHour         p_item.attribute_04%TYPE := apex_escape.html(p_item.attribute_04); -- showHour',
'  l_showMinute       p_item.attribute_05%TYPE := apex_escape.html(p_item.attribute_05); -- showMinute',
'  l_showSecond       p_item.attribute_06%TYPE := apex_escape.html(p_item.attribute_06); -- showSecond',
'  l_timeFormat       p_item.attribute_07%TYPE := apex_escape.html(p_item.attribute_07); -- Time Format',
'  l_beforeDateTime   p_item.attribute_08%TYPE;  -- beforeDateTime',
'  ',
'  -- Other Variables',
'  l_name            VARCHAR2(30);',
'  l_escaped_value   VARCHAR2(4000);',
'  l_html_string     VARCHAR2(2000);',
'  l_onload_code     VARCHAR2(14000);',
'  l_temp            VARCHAR2(4000);',
'  l_element_item_id VARCHAR2(200);',
'',
'BEGIN',
'  -- Set beforeDateTime with ''Basic'' escaping mode to prevent date/time problems',
'  apex_escape.set_html_escaping_mode(''B'');',
'  l_beforeDateTime := apex_escape.html(p_item.attribute_08);',
'  -- Printer Friendly Display',
'  IF p_is_printer_friendly THEN',
'    apex_plugin_util.print_display_only(p_item_name        => p_item.name,',
'                                        p_display_value    => p_value,',
'                                        p_show_line_breaks => FALSE,',
'                                        p_escape           => TRUE,',
'                                        p_attributes       => p_item.element_attributes);',
'  -- Read Only Display',
'  ELSIF p_is_readonly THEN',
'    apex_plugin_util.print_hidden_if_readonly(p_item_name           => p_item.name,',
'                                              p_value               => p_value,',
'                                              p_is_readonly         => p_is_readonly,',
'                                              p_is_printer_friendly => p_is_printer_friendly);',
'  -- Normal Display',
'  ELSE',
'    l_element_item_id := p_item.name;',
'    l_name            := apex_plugin.get_input_name_for_page_item(FALSE);',
'    l_escaped_value   := apex_escape.html(p_value);',
'',
'    -- Build Input HTML String',
'    l_html_string := ''<div type="text" '';',
'    l_html_string := l_html_string || ''id="'' || l_element_item_id || ''"></div> '';',
'',
'    -- Add JavaScript Files',
'    apex_javascript.add_library(p_name           => ''jquery.flipcountdown.js'',',
'                                p_directory      => p_plugin.file_prefix,',
'                                p_version        => NULL,',
'                                p_skip_extension => TRUE);',
'',
'    -- Add CSS Files',
'    apex_css.add_file(p_name           => ''jquery.flipcountdown.css'',',
'                      p_directory      => p_plugin.file_prefix,',
'                      p_skip_extension => TRUE);',
'    ',
'    -- Instantiate onLoad Code',
'    l_onload_code := ''jQuery(function(){',
'            var i = %START_FROM%;',
'            jQuery("#'' || l_element_item_id || ''").flipcountdown({',
'                size: "%SIZE%",',
'                %COUNTER_MODE%',
'                %NON_COUNTER_MODE%',
'            });',
'            });'';',
'    ',
'    -- Set Size',
'    l_onload_code := REPLACE(l_onload_code, ''%SIZE%'', l_size);',
'    ',
'    -- Set Start From',
'    l_onload_code := REPLACE(l_onload_code, ''%START_FROM%'', NVL(l_start_from, 1));',
'    ',
'    IF (l_counter_mode = ''Y'') THEN',
'        l_temp := ''tick:function(){return i++;}'';',
'        l_onload_code := REPLACE(l_onload_code, ''%COUNTER_MODE%'', l_temp);',
'        l_onload_code := REPLACE(l_onload_code, ''%NON_COUNTER_MODE%'', '''');',
'    ELSIF (l_counter_mode = ''N'') THEN',
'        l_onload_code := REPLACE(l_onload_code, ''%COUNTER_MODE%'', '''');',
'        l_temp := ''showHour:''       || CASE l_showHour',
'                                       WHEN ''Y'' THEN ''true''',
'                                       ELSE ''false''',
'                                       END || '','' || ',
'                  ''showMinute:''     || CASE l_showMinute',
'                                       WHEN ''Y'' THEN ''true''',
'                                       ELSE ''false''',
'                                       END || '','' || ',
'                  ''showSecond:''     || CASE l_showSecond',
'                                       WHEN ''Y'' THEN ''true''',
'                                       ELSE ''false''',
'                                       END || '','' || ',
'                  ''am:''             || l_timeFormat || '','' ||',
'                  ''beforeDateTime:'' || '''''''' || l_beforeDateTime || '''''''';',
'        l_onload_code := REPLACE(l_onload_code, ''%NON_COUNTER_MODE%'', l_temp);',
'    END IF;',
'',
'    -- Add Onload Code',
'    apex_javascript.add_onload_code(p_code => l_onload_code);',
'',
'    -- Write Item HTML',
'    htp.p(l_html_string);',
'  END IF;',
'',
'  l_result.is_navigable := TRUE;',
'  RETURN l_result;',
'',
'END render_item;',
''))
,p_api_version=>1
,p_render_function=>'render_item'
,p_standard_attributes=>'VISIBLE'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'This jQuery based item plugin can act as a clock, countdown timer or counter.',
